css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

a.new_post_label > i {
  height: 90px;
}
.new_post_label {
  padding: 74px 1px 5px 0 !important;
  text-transform: lowercase;  
  font-family: serif !important;
}
.new_post_label/*_icon*/ > I {
  background: url('data:image/png;base64,') no-repeat !important;
  z-index: -1;
}

.new_post_label > I {
  color: transparent !important;
  transition: background-position .08s linear !important;
}
#new_post_label_text > I {background-position: 2px -1px !important}
#new_post_label_photo > I {background-position: -73px -1px !important}
#new_post_label_quote > I {background-position: -148px -1px !important}
#new_post_label_link > I {background-position: -223px -1px  !important}
#new_post_label_chat > I {background-position: -298px -1px !important}
#new_post_label_audio > I {background-position: -373px -1px  !important}
#new_post_label_video > I {background-position: -448px -1px  !important}

#new_post_label_text:hover > I {background-position: 2px 4px !important}
#new_post_label_photo:hover > I {background-position: -73px 4px !important}
#new_post_label_quote:hover > I {background-position: -148px 4px !important}
#new_post_label_link:hover > I {background-position: -223px 4px !important}
#new_post_label_chat:hover > I {background-position: -298px 4px !important}
#new_post_label_audio:hover > I {background-position: -373px 4px !important}
#new_post_label_video:hover > I {background-position: -448px 4px !important}

#new_post_label_text:active > I {background-position: 2px -1px !important}
#new_post_label_photo:active > I {background-position: -73px -1px !important}
#new_post_label_quote:active > I {background-position: -148px -1px !important}
#new_post_label_link:active > I {background-position: -223px -1px !important}
#new_post_label_chat:active > I {background-position: -298px -1px !important}
#new_post_label_audio:active > I {background-position: -373px -1px !important}
#new_post_label_video:active > I {background-position: -448px -1px !important}
}
